import logo from './logo.svg';
import './App.css';
import {Routes,Route} from 'react-router-dom'
import React from "react";
import {ProductList} from "./components/ProductList";

function App() {
  return (
    <>
     <Routes>
       <Route path={'/'} element={<ProductList/>}/>
     </Routes>
    </>
  );
}

export default App;
